<!doctype html>
<html lang="en"> {
            width: 100%
            height: 100%
            margin: 0
            padding: 0
        }
    <head>
        <meta charset="utf-8">
        <meta http-equiv="X-UA-Compatible" content="IE=edge">
        <meta name="viewport" content="initial-scale=1,user-scalable=no,maximum-scale=1,width=device-width">
        <meta name="mobile-web-app-capable" content="yes">
        <meta name="apple-mobile-web-app-capable" content="yes">
        <link rel="stylesheet" href="css/leaflet.css">
        <link rel="stylesheet" href="css/qgis2web.css"><link rel="stylesheet" href="css/fontawesome-all.min.css">
        <style>
        #map {
            width: 100%
            height: 100%
            margin: 0
            padding: 0
        }
        </style>
        <title></title>
    </head>
    <body>{
            width: 100%
            height: 100%
            margin: 0
            padding: 0
        }
        <div id="map">
        </div>
        <script src="js/qgis2web_expressions.js"></script>
        <script src="js/leaflet.js"></script>
        <script src="js/leaflet.rotatedMarker.js"></script>
        <script src="js/leaflet.pattern.js"></script>
        <script src="js/leaflet-hash.js"></script>
        <script src="js/Autolinker.min.js"></script>
        <script src="js/rbush.min.js"></script>
        <script src="js/labelgun.min.js"></script>
        <script src="js/labels.js"></script>
        <script src="data/Middle_Branch_1.js"></script>
        <script>
        var map = L.map('map', {
            zoomControl:true, maxZoom:28, minZoom:1
        }).fitBounds([[39.25564264182386,-76.6326455519835],[39.260077413913486,-76.62899477581175]]);
        var hash = new L.Hash(map);
        map.attributionControl.setPrefix('<a href="https://github.com/tomchadwin/qgis2web" target="_blank">qgis2web</a> &middot; <a href="https://leafletjs.com" title="A JS library for interactive maps">Leaflet</a> &middot; <a href="https://qgis.org">QGIS</a>');
        var bounds_group = new L.featureGroup([]);
        function setBounds() {
        }
        var layer_GoogleSatellite_0 = L.tileLayer('http://mt1.google.com/vt/lyrs=s&x={x}&y={y}&z={z}', {
            opacity: 1.0,
            attribution: '',
            minZoom: 1,
            maxZoom: 28,
            minNativeZoom: 0,
            maxNativeZoom: 22
        });
        layer_GoogleSatellite_0;
        map.addLayer(layer_GoogleSatellite_0);
        function pop_Middle_Branch_1(feature, layer) {
            var popupContent = '<table>\
                    <tr>\
                        <td colspan="2">' + (feature.properties['Date'] !== null ? Autolinker.link(feature.properties['Date'].toLocaleString(), {truncate: {length: 30, location: 'smart'}}) : '') + '</td>\
                    </tr>\
                    <tr>\
                        <td colspan="2">' + (feature.properties['Tag Freque'] !== null ? Autolinker.link(feature.properties['Tag Freque'].toLocaleString(), {truncate: {length: 30, location: 'smart'}}) : '') + '</td>\
                    </tr>\
                    <tr>\
                        <td colspan="2">' + (feature.properties['Subject Ba'] !== null ? Autolinker.link(feature.properties['Subject Ba'].toLocaleString(), {truncate: {length: 30, location: 'smart'}}) : '') + '</td>\
                    </tr>\
                </table>';
            layer.bindPopup(popupContent, {maxHeight: 400});
        }

        function style_Middle_Branch_1_0() {
            return {
                pane: 'pane_Middle_Branch_1',
                radius: 4.0,
                opacity: 1,
                color: 'rgba(35,35,35,1.0)',
                dashArray: '',
                lineCap: 'butt',
                lineJoin: 'miter',
                weight: 1,
                fill: true,
                fillOpacity: 1,
                fillColor: 'rgba(245,223,18,1.0)',
                interactive: true,
            }
        }
        map.createPane('pane_Middle_Branch_1');
        map.getPane('pane_Middle_Branch_1').style.zIndex = 401;
        map.getPane('pane_Middle_Branch_1').style['mix-blend-mode'] = 'normal';
        var layer_Middle_Branch_1 = new L.geoJson(json_Middle_Branch_1, {
            attribution: '',
            interactive: true,
            dataVar: 'json_Middle_Branch_1',
            layerName: 'layer_Middle_Branch_1',
            pane: 'pane_Middle_Branch_1',
            onEachFeature: pop_Middle_Branch_1,
            pointToLayer: function (feature, latlng) {
                var context = {
                    feature: feature,
                    variables: {}
                };
                return L.circleMarker(latlng, style_Middle_Branch_1_0(feature));
            },
        });
        bounds_group.addLayer(layer_Middle_Branch_1);
        map.addLayer(layer_Middle_Branch_1);
        setBounds();
        </script>
    </body>
</html>
